import React from "react";
import {Link } from "react-router-dom";

const Navbar = () => {

    return (
        <nav className="navbar-header navbar-light bg-light">
            <div className="container">
                <Link to="/">MarioPlant</Link>
            </div>
        </nav>
    )
}

export default Navbar;
